import './App.css';
import Item from './component/Item';
import IteamDate from './component/ItemDate';
function App() {
  return (
    <div>
      <Item name="first"></Item>
      <IteamDate day="23" month="jan" year="1999"></IteamDate>

      <Item name="mid"></Item>
      <IteamDate day="19" month="feb" year="1988"></IteamDate>

      <Item name="last"></Item>
      <IteamDate day="15" month="mar" year="1995"></IteamDate>
    <div className="App">
    Hello
    </div>
    </div>
  );
}

export default App;
